a:260:{i:0;a:1:{s:2:"id";s:19:"2391086534415382182";}i:1;a:1:{s:10:"short_code";s:11:"CEu2IjXDHam";}i:2;a:1:{s:12:"created_time";i:1599259748;}i:3;a:1:{s:7:"caption";s:1872:"E aí, pessoal. Beleza? A postagem de hoje gira em torno do "quero ajudar" x "quero mostrar que ajudo". Existem pessoas que chegam em nossas vidas e nos ajudam com algum conselho, crítica ou feedback com o único intuito de fazer a gente crescer, reconhecer uma falha, corrigindo-a e nos fazendo evoluir e aprender com isso. Essas pessoas não precisam divulgar que fazem isso, pois o foco não é aparecer. O foco é ajudar.
.
Paralelamente existem pessoas que vão "te ajudar", mas com o intuito te mostrar que está ajudando. O foco não é fazer o bem, é mostrar que "sabe", que entende do assunto. Essas pessoas tentam sempre divulgar que estão fazendo isso devido ao fato de que o principal objetivo é promover a própria imagem, não auxiliar o colega.
.
Então fica um conselho: Valorize alguém que chega para você no privado e tenta te alertar sobre algo, que tenta discutir com você. Essa pessoa dedicou o tempo dela para falar com você e não precisou divulgar isso para ninguém. Então engula seu orgulho, caso seja apontado algum erro ou algo em que você pode melhorar. Pior do que descobrir que está errado ou que deve melhorar em algum aspecto é sentir-se ofendido com a pessoa que te ajudou. 
.
Já sobre as pessoas que querem mostrar que estão te ajudando tome cuidado e aprenda com elas. Elas podem te ensinar não apenas onde você pode melhorar, mas também o tipo de atitude que não devemos copiar.
.
Toda situação pode gerar aprendizado. Você decide se vai querer aprender ou não.

